import React from 'react'
import { useState } from 'react'
const Report = () => {
    const [report, setReport] = useState({});
    onChange__ = (e) => {
        setReport((user) => {
            return {
                "conemail": "", "conname": "", "connumber": "", "conmess": ""
            }
        })
    }


    return (
        <>
            <div >
                <form action='' encType='multipart/html' >
                    <label>Email:</label>
                    <input type='email' name='conemail'></input>
                    <label>Name:</label>
                    <input type='text' name='conname'></input>
                    <label>Mobile Number:</label>
                    <input type='number' name='connumber'></input>
                    <label>Message:</label>
                    <textarea rows='5' cols='3' name='conmess'></textarea>
                </form>
            </div>
        </>
    )
}

export default Report
